import 'bootstrap/dist/css/bootstrap.min.css'
import './Login1.css'
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom';
import { useState } from 'react';
import { Button } from 'bootstrap';



function Login1() {
const [isToger,setToger] = useState(true);
    return (
    <div className='body'>
    <div className="row">
        <div className="col-md-6 d-none d-md-flex"><img src={"backimg.png"} height={20} width={20} alt={"fff"}></img></div>
        <div className="col-lg-6 p-5">
            <div className='titre' ><img src='Nexadz.png' width={140} height={30}/></div>

            {/* la formulaire 1 */}
            {isToger &&  <form className='frm'>
                <div class="mt-3">
                    {/* <div class="form-label d-flex justify-content-start hh" >First name</div> */}
                    <input type="text" class="form-control" placeholder='First name'/>
                </div>
                <div class="mt-3">
                    {/* <label class="form-label d-flex justify-content-start">First name</label> */}
                    <input type="text" class="form-control" placeholder='Last Name'/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Email</label> */}
                    <input type="email" class="form-control" placeholder='Email'/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Phone number</label> */}
                    <input type="text" class="form-control" placeholder='Phone number'/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Password</label> */}
                    <input type="password" class="form-control" placeholder='Password'/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Confirm password</label> */}
                    <input type="password" class="form-control" placeholder='Confirm password'/>
                </div>
                <div class="row mt-3 p-3 d-flex justify-content-center">
                     <button className='btn btn-primary col-4 ms-3 ' > Reset </button>
                     <button className='btn btn-primary col-4 ms-3 ' onClick={()=>setToger(!isToger)}> Next </button>
                </div>
               
            </form>}

            {/* La formulaire 2 */}
            {!isToger && 
            <form className='frm' action='' >
                <div class="mt-3">
                    {/* <div class="form-label d-flex justify-content-start hh" style={{ display: "none" }}>First name</div> */}
                    <input type="text" class="form-control" placeholder='Title'/>
                </div>
                <div class="mt-3">
                    {/* <label class="form-label d-flex justify-content-start">First name</label> */}
                    <input type="text" class="form-control" placeholder='Slogan'/>
                </div>
                <div class="mt-3 row d-flex justify-content-start">
                    {/* <label class="form-label d-flex justify-content-start">Email</label> */}
                    <div class="col-9"><input type="text" class="form-control" placeholder='URl'/></div>
                    <div class="col-3"><input type="text" class="form-control com" placeholder='.com' disabled/></div>
                </div>

                <div class="mt-3 row d-flex justify-content-start">
                    {/* <label class="form-label d-flex justify-content-start">Email</label> */}
                    <input type="file" class="form-control inpt" id="kk"/>
                    <div class="col-3"><label type="text" class="form-control com" for="kk">Upload</label></div>
                    <div class="col-9"><label type="text" class="form-control com" for="kk">No file</label></div>
                </div>


                
                <div class="row mt-3 p-3 d-flex justify-content-center">
                    <button className='btn btn-primary col-3 ms-3' onClick={()=>setToger(!isToger)}>Back</button>
                    <button className='btn btn-primary col-3 ms-3 ' > Reset </button>
                    <button className='btn btn-primary col-3 ms-3' > Next </button>
                </div>
               
            </form>}




        </div>
    </div>
       
    </div>
    );
  }
  
  export default Login1;
